import './App.css';
import {Router as BrowserRouter, Route, Switch} from 'react-router';
import Login from '../src/views/login/Login'
function App() {
  return (

    <div className="App">
      <Router>
        <Switch>       
            <Route path="/" component={Login}></Route>
          </Switch>
        </Router>
    </div>
  );
}

export default App;
